import { Link } from 'react-router-dom';
import { Form } from '../components/form';


export const User = () => {
    return (

        <div className="row mt-5">
            <div className="col-12 mb-3 ">
                <h1>List User</h1>
                <Link to='./issues/list'><button type="submit" className='btn btn-outline-primary'>Go Back</button></Link>
            </div>
            <hr />

            <Form />

        </div>
    )
}
